import React from "react";
import { Route, Routes, BrowserRouter, Redirect } from "react-router-dom";
import User from "./places/users/components/User";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<User />} />
      </Routes>
      <Navigate to="/" />
    </BrowserRouter>
  );
};

export default App;
